  submit(e) {
    e.preventDefault();
  }
 stripePromise = loadStripe('pk_test_JJ1eMdKN0Hp4UFJ6kWXWO4ix00jtXzq5XG');
  render() {
    return (
      <Elements stripe={this.stripePromise}>
        <div className="checkout">
